function About() {
    return (
        <div id="container">
            <div id="content">
                <div id="title">
                    <h1>Over Nederland Stemt</h1>
                </div>
                <div id="containercard">
                    <h2 id="containerheader">Over ons!</h2>
                    <p>Welkom op Nederland Stemt, DE stem pagina van het land! <BR></BR>
                    Breng een stem uit op het onderwerp dat je interesseert!
                    </p>
                </div>
            </div>
        </div>
    );

};

export default About;
